import '../styles/characterDetail.scss';

const CharacterDetail = (props) =>{


    return (
        <section>
            <div>
                <img src={props.data.image} alt={props.data.name} />
             </div>
            <div>
                <h2>{props.data.name}</h2>
                <ul>
                    <li><h3>Status:</h3>{props.data.status}</li>
                    <li><h3>Species</h3>{props.data.species}</li>
                    <li><h3>Origin:</h3>{props.data.origin}</li>
                    <li><h3>Episodes:</h3>{props.data.episodes}</li>
                </ul>
            </div>

        </section>

    );
}

export default CharacterDetail;
